import Types from './Types.js';
import Targets from './Targets.js';


function WorkoutGenerator() {

  function refreshPage() {
    window.location.reload(false);
  }


  return (
    <div className="workout-generator">
      <h2>Generate Workout</h2>
      <form autoComplete="off" action="http://localhost:3000/workouts" method="POST" target="formframe" onSubmit={ () => refreshPage() }>
          <input type="text" id="type" name="type" placeholder="Type" list="typelist" />
          <Types />
          <input type="text" id="target" name="target" placeholder="Target" list="targetlist" />
          <Targets />
          <input type="number" id="reps" name="reps" placeholder="Reps" />
          <input type="submit" placeholder="Submit" />
        </form> 
    </div>
  );
}

export default WorkoutGenerator;
